"use strict";$(document).ready(function(){$("#formAuthentication").parsley()}),window.verifyLogin=((n,e)=>{if($("#btn-login").disableBtnIcon(),e.preventDefault(),$(n).parsley().isValid()){var t=new FormData(n);$("#btn-login").enableBtn(),$.ajax({url:"/Auth/Login",type:"POST",data:t,contentType:!1,processData:!1,beforeSend:function(){$("#btn-login").disableBtnIcon()},success:function(n){$("#btn-login").enableBtn(),200==n.code?($("#login-label").fadeOut(100),window.location.href="/"):$("#login-label").fadeIn(100)},error:function(n,e,t){$("#btn-login").enableBtn(),$("#login-label").fadeIn(100),console.error("Terjadi kesalahan: "+t)},complete:function(){$("#btn-login").enableBtn()}})}else $("#btn-login").enableBtn()});